import React from 'react';
import './App.css';
import Homepage from "./pages/homepage/homepage.component";
import {BrowserRouter,Switch,Route} from "react-router-dom";


const HatsPage =()=>(
  <div>
    <h1>Hats Page</h1>
  </div>
)

function App() {
  return (
    <div>
      <Switch>
     <Route path="/" component={Homepage}/>
     <Route path="/hats" component={HatsPage}/>
     </Switch>
    </div>
  );
}

export default App;
